import React from "react";
import "./App.css";
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const styles = theme => ({
  root: {
    width: '100%',
    marginTop: theme.spacing.unit * 3,
    overflowX: 'auto',
  },
  table: {
    minWidth: 700,
  },
});

class App extends React.Component {
  constructor(){
    super() 
      this.state = {
        schoolData: []
      }
    this.getSchoolList();
  }
  getSchoolList() {
    fetch(process.env.REACT_APP_API_URL + "/schools")
      .then(res => res.json())
      .then(
        (result) => {
          console.log("API_URL1=>", process.env.REACT_APP_API_URL);          
          console.log("result=>", result);
          this.setState({schoolData: result});
          // this.setState({
          //   isLoaded: true,
          //   items: result.items
          // });
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {
    return (
      <table>
      <thead><tr><th>Name</th><th>Country Id</th><th>region Id</th><th>School Code</th></tr></thead>
      <tbody>      
      {this.state.schoolData.map(function(item, key) {
               return (
                  <tr key = {key}>
                      <td>{item.name}</td>
                      <td>{item.countryID}</td>
                      <td>{item.regionID}</td>
                      <td>{item.schoolCode}</td>
                  </tr>
                )             
             })}</tbody>
       </table>
    );
  }
}

SchoolTable.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(SchoolTable);
